import React from 'react';
// import { Outlet, NavLink, Link } from "react-router-dom";
// import { motion } from "framer-motion";
// import {useEffect, useState } from 'react';

function RenderPrice({price, id, hover,name}) {
    if (hover) {
        if (hover.hasOwnProperty('name')){
            if (id === hover.name.split(' ').join('')) {
                return(<span><p id="price"><span style={{textDecoration:'underline',color:'red'}}><b>{price}</b></span></p>
                <p>{name}</p>
                </span>)
            }
        }
    
    }

}
export default RenderPrice;
